import React from "react";

const HomeCard = (props) => {
  <Card key={key}>
    <h2>{props.title}</h2>
    <h5>{props.model === true ? "Serial #" : "Model #"}</h5>
    <p>{props.id}</p>
    <div class="cover" style={{ backgroundImage: `url(${props.image}` }}>

    </div>
  </Card>
}


const Card = styled.div`
  background: white;
  margin-bottom: 1rem;
`;

export default HomeCard;
